function activatePreloadedStyles(){document.querySelectorAll('link[rel="preload"][as="style"][data-make-stylesheet]').forEach(e=>{var r=e.getAttribute("data-href"),t=document.createElement("link");t.rel="stylesheet",t.href=r,t.crossOrigin=e.crossOrigin||"anonymous",t.referrerPolicy=e.referrerPolicy||"no-referrer",e.parentNode.insertBefore(t,e.nextSibling)})}"requestIdleCallback"in window?window.requestIdleCallback(activatePreloadedStyles):setTimeout(activatePreloadedStyles,1);